import './styles/App.css';
import './styles/resetStyle.css';
import React, {Children, Component} from 'react';

function App() {
  return (
    <div className='flex-container'>
      <Header/>
      <Main>
        <DivBlock className="personal-info" blockText="Personal info">
          <InfoField/>
          asd
        </DivBlock>
        <DivBlock className="content" blockText="Main content"/>
      </Main>
      <Footer/>
    </div>
  );
}

// MAIN STRUCTURE ==================================================================================================
class Header extends Component {

  render() {
    return(
      <header className='header'>
        <div className='container'>
          <div className='header-row'>
            CV Application
          </div>
        </div>
      </header>
    );
  }
}

class Main extends Component {

  render() {
    return(
      <main className='main'>
        <DivBlock className="personal-info" blockText="Personal info"/>
        <DivBlock className="content" blockText="Main content"/>
      </main>
    );
  }
}

class DivBlock extends Component {

  render() {
    return(
      <div className={this.props.className}>
        {this.props.blockText}
      </div>
    );
  }
}

class Footer extends Component {

  render() {
    return(
      <footer className='footer'>
        <div className='container'>
          <div className='footer-row'>
            This is a footer
          </div>
        </div>
      </footer>
    );
  }
}

// PERSONAL INFO FIELDS ===================================================================================================
class InfoField extends Component {
  render() {
    return(
      <div>
        <label>{this.props.labelName}</label>
        <input placeholder={this.props.inputPlaceholder}/>
      </div>
    );
  }
}


export default App;
